import React, { Component } from "react";
//import $ from "jquery";
import { Helmet } from "react-helmet";

class events extends Component {
  componentDidMount() {
    //console.log($(".name").val());
  }
  render() {
    return (
      <div className="events">
        <Helmet>
          <script src="../InstagramFeed.min.js" type="text/babel"></script>
          <script src="../instagramrender.js" type="text/babel"></script>
        </Helmet>

        <h1> Instagram Feed </h1>
        <div id="instagram-feed1" className="instagram-feed"></div>

        {/* <input className="name" value="Mau" /> */}
      </div>
    );
  }
}

export default events;
